(9, '455', 15, 20, 3, 0, 'undergraduate-advisor9.pdf', '2024-05-14 16:08:20', '2024', 'สายใจ ไทยยินดี การใช้แบคทีเรียส่งเสริมการเจริญเติบโตของพืชและกรดจัสโมนิกร่วมกับซาลิไซลิกเพื่อส่งเสริมการเจริญเติบโตของกระเจี๊ยบเขียวและข้าวโพดที่ปลูกภายใต้สภาวะแล้ง'),
(10, '455', 15, 20, 3, 0, 'undergraduate-advisor10.pdf', '2024-05-14 16:09:45', '2024', 'นวัตกรณ์ ศิริการ การใช้แบคทีเรียส่งเสริมการเจริญเติบโตของพืชและกรดจัสโมนิกร่วมกับซาลิไซลิกเพื่อส่งเสริมการเจริญเติบโตของกระเจี๊ยบเขียวและข้าวโพดที่ปลูกภายใต้สภาวะแล้ง'),
